CREATE TABLE public.categories (
	id serial4 NOT NULL,
	category_name text NOT NULL,
	CONSTRAINT categories_pkey PRIMARY KEY (id)
);


CREATE TABLE public.products (
	id serial4 NOT NULL,
	title text NOT NULL,
	description text NOT NULL,
	product_cost numeric(65, 30) NOT NULL,
	category_id int4 NOT NULL,
	CONSTRAINT products_pkey PRIMARY KEY (id)
);


CREATE TABLE public.users (
	id serial4 NOT NULL,
	email text NOT NULL,
	first_name text NOT NULL,
	last_name text NOT NULL,
	phone_number text NOT NULL,
	CONSTRAINT users_pkey PRIMARY KEY (id)
);


CREATE TABLE public.sales (
	id serial4 NOT NULL,
	buyer_id int4 NOT NULL,
	product_id int4 NOT NULL,
	transaction_ts timestamp(3) DEFAULT CURRENT_TIMESTAMP NOT NULL,
	num_items int4,
	CONSTRAINT sales_pkey PRIMARY KEY (id)
);


ALTER TABLE public.sales ADD CONSTRAINT "sales_buyer_id_fkey" FOREIGN KEY ("buyer_id") REFERENCES public.users(id) ON DELETE RESTRICT ON UPDATE CASCADE;
ALTER TABLE public.sales ADD CONSTRAINT "sales_product_id_fkey" FOREIGN KEY ("product_id") REFERENCES public.products(id) ON DELETE RESTRICT ON UPDATE CASCADE;
ALTER TABLE public.products ADD CONSTRAINT "products_category_id_fkey" FOREIGN KEY ("category_id") REFERENCES public.categories(id) ON DELETE RESTRICT ON UPDATE CASCADE;

CREATE UNIQUE INDEX users_email_key ON public.users (email);







